import React from 'react'

let Student=(props)=>{
    function handleClick(){
   document.getElementById('root').innerHTML = `hello ${props.name}`;
    }
    return(
        <>
        <h1>Hello {props.name}</h1>
        <button onClick={handleClick}>Button clicked</button>
        </>
    );    
}
export default Student;
